import React, { useEffect, useRef, useState } from 'react';
import './index.css';


    // The data to display
const data = [
    {id: 1, name: 'John', age: 28},
    {id: 2, name: 'Jane', age: 25},
    {id: 3, name: 'Doe', age: 32}
];

    // The table component
const Table = () => {
    return (
        <table>
        <thead>
            <tr>
            <th> </th>
            <th>Company</th>
            <th>Applied</th>
            <th>Rejected</th>
            <th>OA</th>
            <th>Interview</th>
            <th>Final</th>
            <th>Offer</th>

            </tr>
        </thead>
        <tbody>
            {data.map(row => (
            <tr key={row.id}>
                <td>{row.id}</td>
                <td>{row.name}</td>
                <td>{row.age}</td>
            </tr>
            ))}
        </tbody>
        </table>
    );
};

export default Table;
